/** @format */

import React, { Component } from 'react';
import { Card, Row, Col, Badge } from 'react-bootstrap';

class Order extends Component {
    constructor(props) {
        super();
        this.state = {
            pending: [],
            in_process: [],
            completed: [],
            delivered: ['delivered'],
            canceled: ['canceled'],
        };
    }

    render() {
        return (
            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>
                        <Row>
                            <p as={Col}>
                                Order #000{this.props.sku}{' '}
                                <Badge as={Col} bg='secondary'>
                                    {this.props.status}
                                </Badge>
                            </p>
                        </Row>
                    </Card.Title>
                    <Card.Text>
                        <Row>
                            <Col>
                                {this.props.order.type} - {this.props.order.quantity}
                            </Col>
                            <Col>
                            <select>{
                                this.props.status
                            }</select>

                            </Col>
                        </Row>
                    </Card.Text>
                </Card.Body>
            </Card>
        );
    }
}
export default Order;
